import React from "react";
import { useParams } from "react-router-dom";

import PlaceList from "../components/PlaceList";

const DUMMY_PLACES = [
  {
    id: "p1",
    title: "SVNIT- surat",
    description: "One of the reputed NIT's in surat",
    imageUrl:
      "https://static.toiimg.com/thumb/msid-74199347,width-1200,height-900,resizemode-4/.jpg",
    address: "chchhanath Surat- Dumas, Road, Keval Chowk, Surat",
    location: {
      lat: 21.1640345,
      long: 72.7782708,
    },
    creator: "u1",
  },
  {
    id: "p2",
    title: "SVNIT- surat",
    description: "One of the reputed NIT's in surat",
    imageUrl:
      "https://static.toiimg.com/thumb/msid-74199347,width-1200,height-900,resizemode-4/.jpg",
    address: "chchhanath Surat- Dumas, Road, Keval Chowk, Surat",
    location: {
      lat: 21.1640345,
      long: 72.7782708,
    },
    creator: "u2",
  },
];

const UserPlaces = () => {
  return <PlaceList items={DUMMY_PLACES} />;
};

export default UserPlaces;
